import React, { useEffect, useRef } from 'react';

function ContinentsMap() {
  const mapContainer = useRef(null);

  useEffect(() => {
    if (window.jQuery && mapContainer.current) {
      window.jQuery("#map-continents").CSSMap({
        "size": 750,
        "tooltips": "visible",
        "responsive": "auto",
        "visibleList": {
          "enable": true,
          "listPosition": "bottom",
          "columns": 2,
          "columnsGap": 20,
          "columnWidth": 100,
        }
      });
    }

    return () => {
      if (window.jQuery && window.jQuery("#map-continents").data('cssMap')) {
        window.jQuery("#map-continents").data('cssMap').destroy();
      }
    };
  }, []);

  return (
    <div id="map-continents" ref={mapContainer}>
      <ul className="continents">
        <li className="africa"><a href="#africa">Africa</a></li>
        <li className="asia"><a href="#asia">Asia</a></li>
        <li className="australia"><a href="#australia">Australia</a></li>
        <li className="europe"><a href="#europe">Europe</a></li>
        <li className="north-america"><a href="#north-america">North America</a></li>
        <li className="south-america"><a href="#south-america">South America</a></li>
      </ul>
    </div>
  );
}

export default ContinentsMap;
